import React  from "react"

const Table = (props) => {
    const title  = props.tableName;
    const data   = props.details[title];
    const header = Object.keys(data[0])
                .map(values => <th> {values}</th>);
                console.log(header)
    const rows = Object.values(data)
                .map((value, pos) => [ pos+1 ] + Object.values(value))
    return (
    <div>
        <table>
            <tr>
                <th> # </th>
                {header}
            </tr>
            {
                rows.map(row => 
                    <tr>
                        {row.map(val => <td> {val} </td>)}
                    </tr>
                )
            }
        </table>
    </div>
    )

} 

export default Table;
